import React from 'react';
import {Link,NavLink} from 'react-router-dom'
import { Menu, Dropdown, Icon, message } from 'antd';
var HeaderCSS= require('./header.css')

export default class DefaultHeader extends React.Component{
    render(){
        const onClick = ({ key }) => {
            message.info(`Click on item ${key}`);
          };
          
          const menu = (
            <Menu onClick={onClick}>
              <Menu.Item key="1">1st menu item</Menu.Item>
              <Menu.Item key="2">2nd memu item</Menu.Item>
              <Menu.Item key="3">3rd menu item</Menu.Item>
            </Menu>
          );
          
          ReactDOM.render(
            <Dropdown overlay={menu}>
              <a className="ant-dropdown-link" href="#">
                Hover me, Click menu item <Icon type="down" />
              </a>
            </Dropdown>,
            mountNode,
          );
        return(
            <div className={HeaderCSS.header}>
            <div className={HeaderCSS.header1}>
            <a className={HeaderCSS.headertt}><Link to="/homepage">天天影视 </Link></a>
            <a className={HeaderCSS.headerl}><NavLink to="/login">登陆    </NavLink></a>
            
            <div className={HeaderCSS.headeru}>
            <ul className={HeaderCSS.headerul}><a>历史记录</a>
            <li className={HeaderCSS.headerli}><a href="#">一个母亲的复仇</a></li>
            <li className={HeaderCSS.headerli}><a href="#">何以为家</a></li>
            <li className={HeaderCSS.headerli}><a href="#">反贪风暴四</a></li>
            <li className={HeaderCSS.headerli}><a><button className={HeaderCSS.headerlib}>全部清除</button></a></li>
            </ul>
            </div>
            <div  className={HeaderCSS.headers}>
            <input placeholder="大侦探皮卡丘"  type="text" name="name" ></input></div>
            <div>
            <button className={HeaderCSS.headersb}>全网搜</button>
            </div>  
            
            </div>
            </div>
            

            
        )
    }
}
